import React from "react";

function Cards() {
  return (
    <div>
    <div className="card">
    <img className="card-img-top" src="" alt="Card cap"/>
    <div className="card-body">
    <p className="card-text">Pokemon Card</p>
    </div>
    </div>
    </div>
  );
}

export default Cards;
